// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
contract spu {
    address is_admin;
    constructor() {
        is_admin = msg.sender;
    }

    struct course_grade {
        uint student_id;
        uint mark;
    }

    struct student_courses {
        uint couse_id;
        uint weekly_hours;
        uint mark;
    }

    struct course {
        uint id;
        string name;
        string weekly_hour;
        string level;
        string college;
        course_grade[] students_grades;
    }

    struct prof {
        uint id;
        string firstName;
        string lastName;
        string fatherName;
        string motherName;
        string gender;
        string email;
        string collegeName;
        string dateOfBirth;
        string mobileNumber;
        string specialization;
        address prof_address;
    }

    struct student {
        uint id;
        string firstName;
        string lastName;
        string fatherName;
        string motherName;
        string gender;
        string email;
        string collegeName;
        string dateOfBirth;
        string mobileNumber;
        uint256 cumulative_averge;
        address student_address;
        string[] warnnings;
        student_courses[] all_courses;
    }

    modifier onlyemp(address v) {
        require(ChekIfEmp(v) == true);
        _;
    }

    modifier onlyAdmin(address x) {
        require(x == is_admin);
        _;
    }

    uint public s_counter = 0;
    uint public p_counter = 0;
    uint public e_counter = 0;
    uint public c_counter = 0;
    uint public a_counter = 0;

    mapping(uint => address) public get_emp;
    mapping(uint => prof) public get_prof;
    mapping(uint => student) public get_student;
    mapping(uint => course) public get_course;

    address[] public all_employees;
    course[] public spu_courses;

    address[] public all_students;
    uint[] public all_students_id;

    address[] public all_profs;
    uint[] public all_profs_id;

    address[] public authorized;

    function checkRole(address a) public view returns (uint) {
        if (a == is_admin) {
            return 1;
        } else if (ChekIfEmp(a)) {
            return 2;
        } else if (ChekIfprofaddress(a)) {
            return 3;
        } else if (ChekIfstudentaddress(a)) {
            return 4;
        } else if (Chek_If_auhrized(a)) {
            return 5;
        } else {
            return 6;
        }
    }

    function Chek_If_auhrized(address y) public view returns (bool b) {
        for (uint i = 0; i < authorized.length; i++) {
            if (y == authorized[i]) {
                return true;
            }
        }
        return false;
    }
    function ChekIfEmp(address y) public view returns (bool b) {
        for (uint i = 0; i < all_employees.length; i++) {
            if (y == all_employees[i]) {
                return true;
            }
        }
        return false;
    }
    function ChekIfstudent(uint _id) private view returns (bool b) {
        for (uint i = 0; i < all_students_id.length; i++) {
            if (_id == all_students_id[i]) {
                return true;
            }
        }
        return false;
    }

    function ChekIfstudentaddress(address x) public view returns (bool b) {
        for (uint i = 0; i < all_students.length; i++) {
            if (x == all_students[i]) {
                return true;
            }
        }
        return false;
    }
    function ChekIfauthorizedaddress(address x) private view returns (bool b) {
        for (uint i = 0; i < authorized.length; i++) {
            if (x == authorized[i]) {
                return true;
            }
        }
        return false;
    }

    function ChekIfprofaddress(address x) private view returns (bool b) {
        for (uint i = 0; i < all_profs.length; i++) {
            if (x == all_profs[i]) {
                return true;
            }
        }
        return false;
    }

    function ChekIfprof(uint _id) private view returns (bool b) {
        for (uint i = 0; i < all_profs_id.length; i++) {
            if (_id == all_profs_id[i]) {
                return true;
            }
        }
        return false;
